(1, 1, 'Modhu City', '<p>Unveiling the imaginations of urban dwellers and introducing the Eco-friendly environment, MODHU CITY was developed with significant &amp; dynamic aspects of green architecture which was meticulously planned and perfectly designed.</p>', 'images/project-images/Modhu_City_1572249623.JPG', 1, '2019-10-28 14:00:26', '2019-11-04 17:15:37'),
(2, 2, 'Modhu City Extension', '<p>Reviving The Living Standards, offers of MODHU CITY EXTENSION incorporates all the best valued living elements that necessitates for your daily life style. It has sufficiently designed all the utility installations and Eco-friendly sewerage system to make sure healthy and environment friendly living.</p>', 'images/project-images/Modhu_City_Extension_1572250882.JPG', 1, '2019-10-28 14:21:23', '2019-11-03 13:45:31'),
(3, 3, 'Millennium City', '<p>A place belonging magic touch of green-living in an environment friendly community with complementary fresh &amp; clean breathing air accompanied by caring &amp; sharing neighbors throughout the year, is a dream coming true by the grace of heavenly initiative called MILLENNIUM CITY. Unveiling the imaginations of urban dwellers and introducing the eco-friendly environment, MILLENNIUM CITY was developed with significant &amp; dynamic aspects of green architecture which was meticulously planned and perfectly designed.</p>', 'images/project-images/Millennium_City_1572254758.JPG', 0, '2019-10-28 15:26:00', '2019-12-01 08:38:12'),
(4, 4, 'Modhu Haji Lake View', '<p>Green Living with urban lifestyle is no more a myth for tranquility mongers. The urban dwellers of Dhaka city are always dreaming for living accommodations accompanied by garden with plants, open spaces for wander, trees for oxygen and lakes for boating &amp; fishing. A place belonging magic touch of green-living in an environment friendly community with complementary fresh &amp; clean breathing air accompanied by caring &amp; sharing neighbors throughout the year, is a dream coming true by the grace of heavenly initiative called MODHU HAJI LAKE VIEW. A data entry system is provided for visitor&rsquo;s to track visiting time &amp; date, ensuring the availability of 24X7 hours security surveillance on the premises. So feeling safe and secure is no longer an option.</p>', 'images/project-images/Modhu_Haji_Lake_View_1584518899.jpg', 1, '2019-10-28 15:47:32', '2020-03-18 08:08:19'),
(5, 5, 'Modhu City -3', '<p>We are unique in plot hand over on time among the whole real estate industry. It is the outcome of our Successful &amp; on time plot hand over experience of last 5(Five) Projects. This tremendous experience is our inspiration and built confidence of committing our honorable customers the perfect schedule of handover. With a fair track of plot hand over, we came forward with more opportunities towards our customer to fulfill their demand of pure land for housing. We have newly introduced a unique &amp; modern land accommodation under our project MODHU CITY-3</p>', 'images/project-images/Modhu_City_-3_1572256756.JPG', 1, '2019-10-28 15:59:18', '2019-12-01 08:40:03'),
(6, 6, 'Modhu Hazi River View', '<p>Green Living with urban lifestyle is no more a myth for tranquility mongers. The urban dwellers of Dhaka city are always dreaming for living accommodations accompanied by garden with plants, open spaces for wander, trees for oxygen and rivers for boating &amp; fishing.</p>', 'images/project-images/Modhu_Hazi_Rive_View_1572421116.JPG', 1, '2019-10-30 13:38:38', '2019-12-22 09:03:38'),
(7, 7, 'Modhu City- 2', '<p><strong>MODHU CITY-2 </strong>islocated adjacent to 170 feet Western Bypass Road at Basila and the development work is accelerating to facilitate the area as modern town.&nbsp; Among many of the renowned customers, Akij Foundation School and College is advancing constructions to complete their building compound costing over BDT. 250 crores.</p>', 'images/project-images/Modhu_City-_2_1572422045.JPG', 1, '2019-10-30 13:54:06', '2019-10-30 13:54:06'),
(8, 8, 'Modhu City-2 B Block', '<p><strong>MODHU CITY-2 </strong>islocated adjacent to 170 feet Western Bypass Road at Basila and the development work is accelerating to facilitate the area as modern town.&nbsp; Among many of the renowned customers, Akij Foundation School and College is advancing constructions to complete their building compound costing over BDT. 250 crores.</p>', 'images/project-images/Modhu_City-2_B_Block_1576995658.JPG', 1, '2019-12-22 06:20:58', '2019-12-22 06:20:58'),
