INSERT INTO `basics` (`id`, `site_name`, `footer_text`, `about_site`, `footer_text_link`, `favicon`, `created_at`, `updated_at`) VALUES
(1, 'Modhu City', 'YouthFire IT', '<p style=\"text-align: justify;\">Rahat &amp;&nbsp; Rafit Real Estate Ltd. started is journey on 2008 to ease the housing facilities towards the individuals of overpopulated Dhaka city and fulfilling the highly demanding housing needs.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">The rapidly growing population of Dhaka city can make their sweet home to the outskirts with all infrastructural facilities and Modhu City turned this dream in to reality.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">The prime goal of the company is to provide comfortable Real Estate &amp; Housing facilities of the citizens of Bangladesh ensuring extremely secured, aristocrat living condition. So that people can optimize their investment value at the day end.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">By traveling long way, the company has secured its summit position through experiencing different activities which are worthy to be mentioned. It has religiously followed the client&rsquo;s needs and utilized the lesson gathered in the previous projects. Moreover, innovation &amp; partnership is always strengthen its implementation process.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Rahat &amp;&nbsp; Rafit Real Estate Ltd, through major investment in Real-Estate sectors, has tremendously &amp; meaningfully contributed country&rsquo;s economic-stability and employment crisis.&nbsp;&nbsp;&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Seven Latest-Facilitated-Model-Town has been mapped on the outskirt of Dhaka City considering the preference &amp; desire of dwellers and those locations are strategically proven very lucrative for everyone.&nbsp;</p>', 'http://youthfireit.com/', 'assets/frontEnd/img/favicon.png', NULL, '2019-12-03 09:46:51');
INSERT INTO `blogs` (`id`, `category_id`, `title`, `blog_slug`, `short_description`, `details_description`, `feature_image`, `created_at`, `updated_at`) VALUES
(1, 1, 'Land, An Enormous Opportunity for Maximum Profit', 'land,-an-enormous-opportunity-for-maximum-profit', 'According to market nature, Realtors are expecting the land property market to flourish in 2020 overcoming its dull period.', '<p>According to market nature, Realtors are expecting the land property market to flourish in 2020 overcoming its dull period. In addition, single digit bank interest rate inflamed the issue vigorously and made real estate sector more lucrative for investors compared to other business sectors.</p>\r\n<p>Like other sectors, stock market investors are escaping towards more risk free areas and real estate is one of the most secured investment zone without any doubt. A perfect selection can benefit any investor two to three time with in a year or two.</p>\r\n<p>High density of Dhaka city makes inhabitants spend quality time at different resort located at outskirts. Land around Dhaka city only can entertain the growing demand of cottage or home with pure natural beauty. Moreover, people who have little chance to accommodate themselves in suffocating-busy Dhaka city, must take the opportunity to possess a piece of land with natural beauty.</p>\r\n<p>Modhu City is the perfect choice with it&rsquo;s well planned accommodation accompanied by logistic &amp; infrastructures facilities. Sufficient room for roads, substation for unplugged electricity, Gas lines to inhabitants, Schools for quality education, College for enlighten students, Mosque for Prayers, market for shopping etc. are common facilities one will avail in Modhucity.</p>\r\n<p>Ongoing political status of the country made the real estate more return oriented for investors with maximum benefits. After having long stagnant market, a sharp uprising trend made this sector more profitable than any present-day venture.</p>\r\n<p><strong>For Best Future investment in lands is the most suitable</strong></p>\r\n<p>Think of Investment pops up real estate sector in most people&rsquo;s minds at first place. Potentiality of this sector never fade out even in recession of the country. Among different segments of real estate sector like buying homes, apartments &amp; flats or commercial property, the most lucrative is purchasing lands or plots due to its versatile range of price. One may not afford flats or apartments but can afford lands or plots.</p>\r\n<p>Investments in real estate is the right choice for you when you select lands or plots with adequate knowledge about them. Several benefits of choosing this sector often encountered by widespread question marks. The most common questions are as follows:</p>\r\n<ul>\r\n<li>Will it ensure income?</li>\r\n<li>Will it be an idle investment?</li>\r\n<li>What will be the investment return?</li>\r\n</ul>\r\n<p>We ensure that the questions are fully encountered by the facts that &ndash; vacant land generates tremendous cash flow as it provides of the best investment return in the world with its versatility &amp; easy to cash nature. Volume of return may vary due to perfection of time or strategy but result is for sure.</p>\r\n<p>Like other commodities, land does not have prompt animations. But it has hidden worth that exposes in course of time. Selecting right piece of land may arise different types or magnitudes of problems. It also has variety of solutions. All you have to do is to educate yourself with the relevant laws, facilities and supports government &amp; regulatory body is providing.&nbsp;</p>\r\n<p>Why Investment in real estate are so lucrative? We can consider the following criterions:</p>\r\n<p><strong>Vacant land itself is the winner of battle</strong></p>\r\n<p>You don&rsquo;t have to be expert in the field of construction of engineering as we need in building development. All you have to be sure that purchasing land will be suitable enough for building construction immediately after possession. The battle of ensuring maximum return is for sure when you are confirmed that the land is ready enough to start any building construction.</p>\r\n<p><strong>Raw Land is the &ldquo;Easy to cash&rdquo; Investment.</strong></p>\r\n<p>Ownership of building must meet hassle dealing with holders, bugs, molds, toilets, lawn care, bursting pipes, leaking roofs, broken furnaces and the hundreds of other problems of a building? Luckily, land ownership doesn&rsquo;t require any of mentioned problems. When someone buy it, it behaves itself and nothing happens.</p>\r\n<p><strong>Land buyers are beyond the competition</strong></p>\r\n<p>Are you exhausted of extreme struggle on every property you prefer to buy? Are you sick of losing every opportunity you are lucky enough to find? Well, guess what! There is very little competition in the world of raw land investment. It is crystal clear, almost all real estate investors consider things like houses, flats &amp; apartments, commercial property and so on &ndash; as everyone else does. Few investors realize the maximum benefits that come with a vacant land and this is the advantage.</p>', 'images/blog-images/1574653772.jpg', '2019-11-13 04:59:49', '2019-11-25 03:49:33');
