(1, 'md', 'Managing Director', '<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:black\">Keeping the main focus on business expansion and growth in land-development, the group is continuously taking up projects to make it the largest conglomerate in the real-estate arena of Bangladesh.Be dependent on the firm foundation and highly professional human resources, the group is still making good use of its business possibilities and also contributing to the improvement of the local corporate culture and making a significant contribution to the overall progress of the country and its economy.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:black\">However, despite fascinating growth and business expansion, the company&rsquo;s aims and objectives are to serve people with maximum satisfaction and continue the strive for the greater happiness of the people and the country.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:black\">As a mentor of the ModhuGroup, I hope that the cordial relations with all the valued clients will remain intact as partners of prosperity and we also look forward to build more successful relations with potential clients in the future. Thus ourstakeholders will be served and grown even better onward.</span></span></span></span></span></p>', 1, '2019-10-31 13:36:16', '2019-10-31 13:36:16'),
