INSERT INTO `projects` (`id`, `project_type`, `project_status`, `project_name`, `project_slug`, `project_description`, `project_location`, `project_image`, `publication_status`, `created_at`, `updated_at`) VALUES
(1, 'land', 'ongoing', 'Modhu City', 'modhu-city', 'Unveiling the imaginations of urban dwellers and introducing the Eco-friendly environment, MODHU CITY was developed with significant & dynamic aspects of green architecture which was meticulously planned and perfectly designed.', 'Bosila, Dhaka', 'images/project-images/Modhu_City_Modhu_city_42_1572249548.JPG', 1, '2019-10-28 13:59:10', '2019-12-01 08:38:51'),
(2, 'land', 'ongoing', 'Modhu City Extension', 'modhu-city-extension', 'Reviving The Living Standards, offers of MODHU CITY EXTENSION incorporates all the best valued living elements that necessitates for your daily life style. It has sufficiently designed all the utility installations and Eco-friendly sewerage system to make sure healthy and environment friendly living.', 'Ati Bazar, keranigonj, Dhaka', 'images/project-images/Modhu_City_Extension_Modhu_city_-2_\r\n46_1572250815.JPG', 1, '2019-10-28 14:20:17', '2019-12-01 08:36:25'),
(3, 'land', 'ongoing', 'Millennium City', 'millennium-city', 'A place belonging magic touch of green-living in an environment friendly community with complementary fresh & clean breathing air accompanied by caring & sharing neighbors throughout the year, is a dream coming true by the grace of heavenly initiative called MILLENNIUM CITY.', 'Totail, Keranigonj, Dhaka', 'images/project-images/Millennium_City_1572254700.JPG', 1, '2019-10-28 15:25:01', '2019-12-01 08:38:12'),
(4, 'land', 'completed', 'Modhu Haji Lake View', 'modhu-haji-lake-view', 'A place belonging magic touch of green-living in an environment friendly community with complementary fresh & clean breathing air accompanied by caring & sharing neighbors throughout the year, is a dream coming true by the grace of heavenly initiative called MODHU HAJI LAKE VIEW.', 'Beribad, Hazaribug,Dhaka', 'images/project-images/Modhu_Haji_Lake_View_1584518899.jpg', 0, '2019-10-28 15:46:49', '2020-09-13 00:17:59'),
(5, 'land', 'upcoming', 'Modhu City -3', 'modhu-city -3', 'We are unique in plot hand over on time among the whole real estate industry. It is the outcome of our Successful & on time plot hand over experience of last 5(Five) Projects.', 'Hizla, Ati Bazar, Keranigonj, Dhaka', 'images/project-images/Modhu_City_-3_1572256677.JPG', 1, '2019-10-28 15:57:58', '2019-12-10 04:31:50'),
(6, 'land', 'ongoing', 'Modhu Hazi River View', 'modhu-hazi-river-view', 'Green Living with urban lifestyle is no more a myth for tranquility mongers. The urban dwellers of Dhaka city are always dreaming for living accommodations accompanied by garden with plants, open spaces for wander, trees for oxygen and rivers for boating & fishing.', 'Arshi Nagar, Keranigonj, Dhaka', 'images/project-images/ModhuHazi_Rive_View_1575188475.JPG', 0, '2019-10-30 13:37:01', '2020-09-01 22:03:06'),
(7, 'land', 'ongoing', 'Modhu City- 2', 'modhu-city- 2', 'MODHU CITY-2 is located adjacent to 170 feet Western Bypass Road at Basila and the development work is accelerating to facilitate the area as modern town.  Among many of the renowned customers, Akij Foundation School and College is advancing constructions to complete their building compound costing over BDT. 250 crores.', 'Boro Monohoria, Keranigonj, Dhaka', 'images/project-images/Modhu_City-_2_1572421902.JPG', 1, '2019-10-30 13:51:43', '2019-12-01 08:37:21'),
(8, 'land', 'upcoming', 'Modhu City- 2 B Block', 'modhu-city- 2-b-block', 'MODHU CITY-2 is located adjacent to 170 feet Western Bypass Road at Basila and the development work is accelerating to facilitate the area as modern town.  Among many of the renowned customers, Akij Foundation School and College is advancing constructions to complete their building compound costing over BDT. 250 crores.', 'Boro Monohoria, Keranigonj, Dhaka', 'images/project-images/Modhu_City-_2_B_Block_1576995457.JPG', 1, '2019-12-22 06:17:38', '2019-12-22 06:17:38'),
(9, 'land', 'upcoming', 'Modhu Hazi River View B Block', 'modhu-hazi-river-view-b-block', 'Green Living with urban lifestyle is no more a myth for tranquility mongers. The urban dwellers of Dhaka city are always dreaming for living accommodations accompanied by garden with plants, open spaces for wander, trees for oxygen and rivers for boating & fishing.', 'Arshi Nagar, Keranigonj, Dhaka', 'images/project-images/ModhuHazi_Rive_View_1575188475.JPG', 1, '2019-10-30 13:37:01', '2019-12-22 09:07:18');
INSERT INTO `project_facilities` (`id`, `project_id`, `special_facilities_text`, `special_facilities`, `infrastructural_facilities_text`, `infrastructural_facilities`, `plot_accomodation_text`, `plot_accomodations`, `plot_accomodations_measure_by`, `roads_text`, `roads`, `roads_measure_by`, `created_at`, `updated_at`) VALUES
(1, 1, 'Unveiling the imaginations of urban dwellers and introducing the eco-friendly environment, MODHU CITY was developed with significant & dynamic aspects of green architecture which was meticulously planned and perfectly designed.', 'Several Mosques,Bangla Medium Schools, English Medium Schools,Colleges,Universities,Medical Colleges,Hospitals,Clinics,Modern Shopping Malls,Banks,Insurances,community Centers,Playground,Parks,Clubs,Amusement Parks,Water Parks,Gymnasium,Convention Centre,Lake in residential zone,Filling Stations,Common Parking,Restaurants,Trade Centers,Eidgah,Graveyard,Hotels', 'MODHU CITY will provide every Modern-City-Life Infrastructural Facilities to its inhabitants. As per Government’s Regulations towards the Land Development sector the following infrastructure must be provided:', 'Water,Gas,Electricity,Telephone,Post office,Sewerage Line,Fire Service,Police Station / Fari', 'As per customer requirements MODHU CITY knocked every-level-requirements of satisfaction and made the plot more diversified in sizes.  Plots are allocated as accordingly:', '3, 5, 7, 10', 'Khatas', 'MODHU CITY highly evaluated the necessity of internal roads netted through project and segmented accordingly required. Under mentioned effort, the prudential parameter of the road are widen as below:', '20, 30, 40', 'Feets', '2019-10-28 14:11:31', '2019-10-28 14:11:31'),
