INSERT INTO `project_why_chooses` (`id`, `project_id`, `why_choose_title`, `why_choose_description`, `publication_status`, `created_at`, `updated_at`) VALUES
(1, 1, 'Modhu City', '<ul>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">Modhu CITY is a successful hand over project.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">A unique project having a pure and natural greeneries and landscape.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">This project is adjacent to Connecting road of &lsquo;Shohid Buddhijibi Koborsthan&rsquo;</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">170 feet Western bypass road is in the west of modhu city and the mentioned road is the only connecting road to Dhaka-Aricha&amp; Dhaka-Mawa mass road.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">Modhu CITY with its Residential and Commercial Plots put options for the people living in every level of society and help them find their own dignity.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">The renowned&amp; talk of the town Modhu CITY FOOD COURT is located in this project. This Food court already became the hub of amusement to the city dwellers.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of Modhu CITY.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">The Modhu CITY is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">A tremendous investment opportunity maximizing profit on land purchase value from the very first day.</li>\r\n<li style=\"font-family: \'Montserrat\', sans-serif !important;\">To make Environment-Friendly Project, a part of total land will be reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</li>\r\n</ul>', 1, '2019-10-28 14:03:33', '2019-12-22 09:20:00'),
(2, 2, 'Modhu City Extension', '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A unique project having a pure and natural greeneries and landscape.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of</span><strong><span style=\"font-size:10.0pt\"><span style=\"color:black\">modhu city extension</span></span></strong><strong><span style=\"color:black\">. </span></strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">The</span><strong><span style=\"font-size:10.0pt\"><span style=\"color:black\">modhu city extension</span></span></strong><span style=\"color:black\">is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A tremendous investment opportunity maximizing profit on land purchase value from the very first day .</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">To make Environment Friendly Project, a part of total land will be reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</span></span></span></li>\r\n</ul>', 1, '2019-10-28 15:07:07', '2019-10-28 15:07:07'),
(3, 3, 'Millennium City', '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">This city is situated on the 120 feet wide road that connects Basila&amp; Mohammad pur</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A unique project having a pure and natural greeneries and landscape.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Few of the ready plots will be delivered on first come first serve. </span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of </span><strong><span style=\"font-size:10.0pt\"><span style=\"background-color:white\"><span style=\"color:black\">MILLENNIUM CITY</span></span></span></strong><strong><span style=\"color:black\">. </span></strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">The</span><strong><span style=\"font-size:10.0pt\"><span style=\"background-color:white\"><span style=\"color:black\">MILLENNIUM CITY </span></span></span></strong><span style=\"color:black\">is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A tremendous investment opportunity maximizing profit on land purchase value from the very first day.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">To make Environment Friendly Project, enough land will be reserved for Ecological Balance Greeneries and Open Spaces etc.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">MILLENNIUM CITY is completely flood-free zone by default and suitable enough for construction due to soil condition.</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">MILLENNIUM CITY with its Residential and Commercial Plots put options for the people living in every level of society and help them find their own dignity.</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Public welfare and Ecological balance is a must for MILLENNIUM CITY and with this mission it secured a part of its total land to satisfy the mention accommodation.</span></span></span></span></li>\r\n</ul>', 1, '2019-10-28 15:36:13', '2019-10-28 15:36:13'),
(4, 4, 'Modhu Haji Lake View', '<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">A unique project having a pure and natural greeneries and landscape.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">This project is located adjacent to Gabtoli-Sadarghat main road(Beribadh) in Hajaribaghof Mohammadpur- Bosila. </span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">This project started on 2013 and handover on 2015 successfully. </span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><strong><span style=\"color: black;\">100%</span></strong><span style=\"color: black;\"> ready plot with the accommodation similar to Dhanmondi&amp;Mohammadpur. </span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">Housing activities are now running in full swing of modhu haji lake View</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"background-color: white;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">modhu haji lake View is completely flood-free zone by default and suitable enough for construction due to soil condition.</span></span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of modhu haji lake View. </span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">Themodhu haji lake View is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">Construction of Al-ArafaIslami Bank is also going on.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">A tremendous investment opportunity maximizing profit and become billionaire.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">To make Environment Friendly Project, a part of total land will be reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</span></span></span></li>\r\n</ul>', 1, '2019-10-28 15:49:33', '2020-03-18 08:08:19'),
(5, 5, 'Modhu City -3', '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"font-size:12.0pt\"><span style=\"color:black\">MODHU CITY-3 is </span></span><span style=\"color:black\">a unique project having pure and hassle free Land.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Location of </span><span style=\"font-size:12.0pt\"><span style=\"color:black\">MODHU CITY-3 is </span></span><span style=\"color:black\">Only 7 Kilometers away from National Parliament of Bangladesh</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Respectively 170, 90, 80, 60, 40, 25 Feet wideRoads are streaming inside </span><span style=\"font-size:12.0pt\"><span style=\"color:black\">MODHU CITY-3</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"font-size:12.0pt\"><span style=\"color:black\">By default, 3(Three) Lakes are located around this projects.</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"font-size:12.0pt\"><span style=\"color:black\">MODHU CITY-3 is Fully Nature -Friendly Project.</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A tremendous investment opportunity maximizing profit on land purchase value even the day of purchase.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">The</span><span style=\"font-size:12.0pt\"><span style=\"color:black\">MODHU CITY-3 </span></span><span style=\"color:black\">is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">To make Environment Friendly Project, more than enough of total land will be reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</span></span></span></li>\r\n</ul>', 1, '2019-10-28 16:02:17', '2019-10-28 16:02:17'),
(6, 6, 'Modhu Hazi River View', '<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"color: black;\">Modhu hazi River </span></span></strong><strong><span style=\"font-size: 10.0pt;\"><span style=\"color: black;\">VIEW is</span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"color: black;\"> located at Arshinagar of Mohammadpur- Basila</span></span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"font-size: 10.0pt;\"><span style=\"color: black;\">100% ready plot for living accommodation similar to Dhanmondi-Mohammadpur</span></span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">A unique project having a pure and natural greeneries and landscape.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of </span><strong><span style=\"font-size: 10.0pt;\"><span style=\"color: black;\">Modhu hazi River view.</span></span></strong></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">The</span><strong><span style=\"font-size: 10.0pt;\"><span style=\"color: black;\">Modhu hazi River view</span></span></strong><span style=\"color: black;\">is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">A tremendous investment opportunity maximizing profit and become billionaire soon.</span></span></span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Montserrat\', sans-serif!important;\"><span style=\"color: black;\">To make Environment Friendly Project, a part of total land is reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</span></span></span></li>\r\n</ul>', 1, '2019-10-30 13:41:07', '2019-12-22 09:09:15'),
(7, 7, 'Modhu City- 2', '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A unique project having a pure and natural greeneries and landscape.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Location of </span><strong><span style=\"font-size:10.0pt\"><span style=\"background-color:white\"><span style=\"color:black\">MODHU CITY-2 </span></span></span></strong><span style=\"color:black\">just beside </span><span style=\"font-size:12.0pt\"><span style=\"color:black\">Western Bypass Road at Basila</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Surrounding brick walls for separating from outsiders.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Biggest Madrasha in Asia withadjacent mosque. </span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A resort for quality time spending of the inhabitants</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of </span><strong><span style=\"font-size:10.0pt\"><span style=\"background-color:white\"><span style=\"color:black\">MODHU CITY-2</span></span></span></strong><strong><span style=\"color:black\">. </span></strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">The</span><strong><span style=\"font-size:10.0pt\"><span style=\"background-color:white\"><span style=\"color:black\"> MODHU CITY-2 </span></span></span></strong><span style=\"color:black\">is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">A tremendous investment opportunity maximizing profit on land purchase value from the very first day.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">To make Environment Friendly Project, enough land will be reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">MODHU CITY-2 is completely flood-free zone by default and suitable enough for construction due to soil condition.</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">MODHU CITY-2 with its Residential and Commercial Plots put options for the people living in every level of society and help them find their own dignity.</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:\'Montserrat\', sans-serif!important;\"><span style=\"color:black\">Public welfare and Ecological balance is a must for MODHU CITY-2 and with this mission it secured a part of its total land to satisfy the mention accommodation.</span></span></span></span></li>\r\n</ul>', 1, '2019-10-30 14:01:12', '2019-10-30 14:01:12'),
(8, 8, 'MODHU CITY-2  B Block', '<hr />\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">A unique project having a pure and natural greeneries and landscape.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">Location of&nbsp;<strong>MODHU CITY-2&nbsp; B Block&nbsp;</strong>just beside&nbsp;Western Bypass Road at Basila</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">Surrounding brick walls for separating from outsiders.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">Biggest Madrasha in Asia withadjacent mosque.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">A resort for quality time spending of the inhabitants</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">A number of Professional Engineers, Town Planners, Architects and Environmentalists formed a team to design the well-organized layout plan of&nbsp;<strong>MODHU CITY-2&nbsp;B Block.</strong></li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">The<strong>&nbsp;MODHU CITY-2&nbsp; B Block&nbsp;</strong>is free from &amp; away of Dhaka-City-Air-pollution caused by crippling traffic jams</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">A tremendous investment opportunity maximizing profit on land purchase value from the very first day.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">To make Environment Friendly Project, enough land will be reserved for Ecological Balance Greeneries, Lakes and Open Spaces etc.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">MODHU CITY-2&nbsp;<strong>B Block</strong> is completely flood-free zone by default and suitable enough for construction due to soil condition.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">MODHU CITY-2&nbsp;<strong>B Block</strong> with its Residential and Commercial Plots put options for the people living in every level of society and help them find their own dignity.</li>\r\n	<li style=\"font-family:\'Montserrat\', sans-serif!important;\">Public welfare and Ecological balance is a must for MODHU CITY-2 and with this mission it secured a part of its total land to satisfy the mention accommodation.</li>\r\n</ul>', 1, '2019-12-22 06:26:33', '2019-12-22 06:26:33'),
